import logo from './logo.svg';
import './index.css';
import Question from "./components/question.js";


import React, { useEffect, useState,  Component }  from 'react';



function App() {
  let [questionIndex, setIndex] = useState(1);


  let quiz = [{
        text: "How many Ducks?",
        answers: [{
          text: "5",
          isRight: false
        }, {
          text: "2",
          isRight: false
        }, {
          text: "3",
          isRight: true
        }, {
          text: "4",
          isRight: false
        }],

      },{
        text: "How many Dogs?",
        answers: [{
          text: "5123",
          isRight: false
        }, {
          text: "2323",
          isRight: true
        }, {
          text: "3123",
          isRight: false
        }, {
          text: "4123",
          isRight: false
        }],
      }];




  return (
    <div className="App">
        <Question question={quiz[questionIndex]} index={questionIndex} numberOfQuestions={quiz.length}/>
    </div>
  );
}

export default App;
